import React from 'react';
import ReactDOM from 'react-dom';
import './pageNav.scss';

const PageLogo = () => {
    return (
        <img className="nav__logo" src='../../assets/Logo/Logo-brainflix.svg' alt="site-logo"></img>
    )
}

const PageNavButton = () => {
    return (
        <button className="nav__upload"> +UPLOAD </button>
    )
}

const PageNavPhoto = () => {
    return (
        <img className="nav__photo" src='../../../assets/Images/Mohan-muruge.jpg' alt="site-logo"></img>
    )
}

const PageNav = () => {
    return (
     <nav className="nav">
         <PageLogo />
         <PageNavButton />
         <PageNavPhoto />
     </nav>);
}

ReactDOM.render(
    <PageNav />,
    document.getElementById('header')
)
